import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a> */}
        <p><strong>#করোনার_সময়_ক্লাস_নয়</strong> ইভেন্টে প্ল্যাকার্ড হাতে নিজের ছবি পোষ্ট করুন এবং আমাদের পাশে এসে দাঁড়ান।  </p>
        <img 
        className = "images"
        src="https://scontent.fdac5-1.fna.fbcdn.net/v/t1.0-9/s960x960/89959275_10158244502566462_3525709133976174592_o.jpg?_nc_cat=104&_nc_sid=02d79f&_nc_eui2=AeHTdLjtSXm4hCsNJlL57Pf6ic3JEDcUK99-eeBNPkHXC9enRa3HTwSYx3cihwIl9-pJkmuy8fgvIQI1z4mz2D5_4P41yO5aeaO_EujPUEGIKA&_nc_ohc=wsxvOuLa7IwAX_nJnbk&_nc_ht=scontent.fdac5-1.fna&_nc_tp=7&oh=482dcd25dfca9e5a7c0b32ce1fc1b835&oe=5E917392"></img>
      </header>
    </div>
  );
}

export default App;
